  and Clear Lake in California, Upper Klamath and Klamath Forest in Oregon: May -
  August, 1963\",\n\t\"tracking_summary\": {\n\t\t\"total\": 7,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
