  \"narrative-report-klamath-basin-national-wildlife-refuges-tule-lake-lower-klamath-and-clear-2a246\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tule Lake National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1963.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, big game animals, furbearers, predators, rodents, raptors, and disease- is
  also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, and vegetation control. A progress report on field investigations
  and applied research is included. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and hunting. Items of
  interest, N-R forms, photographs, and narrative reports for Upper Klamath National
  Wildlife Refuge, Lower Klamath National Wildlife Refuge, Clear Lake, and Klamath
  Forest National Wildlife Refuge are attached.\",\n\t\"license_title\": \"License
